import axios from "axios"
import { URL_EMAIL_SEND_EMAIL } from "../utility/Endpoint"

export async function email(utente){
  return await axios.post(URL_EMAIL_SEND_EMAIL,utente).then((response)=>{
      alert(response)

  }).catch((error)=>{
      console.log(error)
  })
}
